import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class apiCall extends Component {
  callApi = () => {
    var req = new XMLHttpRequest();
    const value = document.getElementById('txtValue').value;
    const url = 'http://127.0.0.1';
    const port = '2020' || '3030';

    req.open('GET', `${url}:${port}/calculate-fibonnaci/${value}`, false);

    req.onreadystatechange = (res) => {
      if(req.readyState === 4) {
        if(req.status === 200) {
          const response = JSON.parse(req.response);
          document.getElementById('lblResult').innerHTML = response.result;
        }
      }
    };

    req.send(null);    
  };
}

function App() {
  const api = new apiCall();

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

          <h1>Calculate Fibonnaci!</h1>
          <form>
            <input type="text" id="txtValue" name="txtValue"></input>
          </form>
          <button onClick={api.callApi}>Calculate</button>
          <label>Fibonnaci Result: </label>
          <label id="lblResult"></label>
      </header>
    </div>
  );
}

export default App;
